import React from "react";
import { useSpring, animated } from "react-spring";

function Navigation() {
  const props = useSpring({
    to: { opacity: 1, marginRight: 0 },
    from: { opacity: 0, marginRight: -500 },
    config: { delay: 1000, duration: 4000 },
  });
  const props2 = useSpring({
    to: { opacity: 1, marginTop: 0 },
    from: { opacity: 0, marginTop: -500 },
    config: { delay: 1000, duration: 6000 },
  });
  return (
    <header className="navbar font">
      <a href="mailto:giupi.deluca@hotmail.com" className="anchorNav email">
        {/* <animated.div style={{ display: "inline", ...props }}>
          email
        </animated.div>
        <animated.div style={{ display: "inline", ...props2 }}>
          {" "}
          me
        </animated.div> */}
      </a>

      <nav>
        <animated.div style={{ display: "inline", ...props }}>
          <a
            href="https://www.linkedin.com/in/giupi-deluca/"
            target="_blank"
            className="anchorNav"
          >
            <i className="fa fa-linkedin-square"></i>
          </a>

          <a
            href="https://github.com/GiupiDeLuca"
            target="_blank"
            className="anchorNav"
          >
            <i class="fa fa-github"></i>
          </a>
          <a
            href="mailto:giupi.deluca@hotmail.com"
            target="_blank"
            className="anchorNav"
          >
            <i class="fa fa-envelope" style={{ color: "whitesmoke" }}></i>
          </a>
        </animated.div>
      </nav>
    </header>
  );
}

export default Navigation;
